description:
 Well today Kristina went to the store to buy a pair of jeans and the day was going just fine until she got to the store. First the guy behind the counter had a major attitude problem and then every pair of jeans she went to try on could not fit! Now Kristina is a very voluptuous woman I mean she really has some Monster Curves and those jeans were not moving over that super fat ass of hers! She needed some help, So she asked the guy behind the counter for a hand and he was quickly there to try to help her squeeze into those jeans! Long story short the jeans wouldnt fit but to make it up to her VooDoo decided to give her a pair of shoes instead which she loved! He charged her no charge but she decided to give him a tip for his hard work! She gave him one hell of a tip to say the least!!! A MUST HAVE!! Enjoy!

